import {combineReducers} from "redux";
import {authReducer} from "./auth.reducer";
import {userReducer} from "./user.reducer";
import {trReducer} from "./tr.reducer";

export const rootReducer = combineReducers({
    message: authReducer,
    user: userReducer,
    tr: trReducer,

});
